Your task is to efficiently analyze the content of the provided article PDF and extract information about co-crystals and their properties. For each cocrystal described in the input PDF, extract the following information:
1. Compound Name: The name of the cocrystal (e.g., 'CAR-HCT').
2. Ratio: The molar ratio of the cocrystal components (e.g., '2:1').
3. Drug Name: Record the name of the primary drug in the cocrystal (e.g., 'carvedilol').
4. Drug SMILES: Extract the SMILES representation of the drug (e.g., 'CC1=CC=C(C=C1)C(=O)Nc2ccc(cc2)C(=O)N3CCCCC3=O'). 
5. Coformer Name: Identify the name of the coformer used with the drug (e.g., 'saccharin').
6. Coformer SMILES: Extract the SMILES representation of the coformer (e.g., 'O=C(O)CC(O)C(=O)O').
7. Photostability Trend: Report the trend of photostability for both the cocrystal and the drug, indicating how their stability changes over time ('decrease' or ‘does not change’ or ’increase’). 
If the article references multiple samples or variations of compounds tested, ensure to extract and compile each unique set of ‘Compound Name’, ‘Ratio’, ‘Drug Name’, ‘Drug SMILES’, ‘Coformer Name’, ‘Coformer SMILES’, and ‘Photostability Trend’ information. Make sure to maintain the association between each drug and coformer along with the photostability trend. 
Your output should be in JSON format  and should not contain any explanatory text. Here is the example:
```json
[
{
'Compound Name': 'CAR-HCT',
'Ratio': '2:1',
'Drug': {
“Drug Name”: 'carvedilol',
'Drug SMILES': 'C1=CC(=C(C=C1O)O)C=CC2=CC(=CC(=C2)O)O'
},
'Coformer': {
Coformer Name”: 'saccharin',
'Coformer SMILES': 'O=C(O)CC(O)C(=O)O'
},
'Photostability Trend': 'decrease'
},
{
'Compound Name': 'DMZ-SAC',
'Ratio': '0.5:1',
'Drug': {
“Drug Name”: 'Epalrestat',
'Drug SMILES': 'C1=CC(=C(C=C1O)O)C=CC2=CC(=CC(=C2)O)O'
},
,
'Coformer': {
Coformer Name”: 'oxalic acid',
'Coformer SMILES': 'C(=C/C(=O)O)\C(=O)O'
},
'Photostability Trend': 'does not change'
}
]
```
Do not skip any entries. If multiple cocrystals are reported for the same drug, list them as separate entries. It is imperative that you should not make up any additional information or take the information you already know. If you did not find the parameter in the text, write ‘NaN’.

